import React from 'react'
import handleTyping from '../helpers/handleTyping'

//SearchBox component provides a search box field.

const SearchBox = ({search, setSearch}) => {

    
    return(
        <div>
            Find countries <input value={search} onChange={(e) => handleTyping(setSearch ,e)} />
        </div>
    )
}

export default SearchBox
